import React from "react";
import { useEntryContext } from "../context/TableContext";

const Table = () => {
  const data = useEntryContext();
  console.log(data);
  return (
    <div>
      <h2>Table</h2>
      <table>
        <tr>
          <th> name </th>
          <th> email </th>
          <th> phone </th>
          <th> message </th>
        </tr>
        {data.state.entries &&
          data.state.entries.map((entry, index) => (
            <tr key={index}>
              <td>{entry.name}</td>
              <td>{entry.email}</td>
              <td>{entry.phone}</td>
              <td>{entry.phone}</td>
            </tr>
          ))}
      </table>
    </div>
  );
};

export default Table;
